// ALWAYS write components file name with first letter capital (ALWAYS!!)

// PROPS ARE READ ONLYYYY!!

import React from "react";
import PropTypes from 'prop-types'

export default function Navbar(props) {
  // let modeStyle = "navbar navbar-expand-lg navbar-light bg-light";
  // if(mode === true){
  //   modeStyle = "navbar navbar-expand-lg navbar-dark bg-dark";
  // }

  return (
    <nav className={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
      <div className="container-fluid">
        <a className="navbar-brand" href="/">
          {props.title}
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="/">
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/">
                About
              </a>
            </li>
          </ul>
          {/* <form className="d-flex" role="search">
            <input
              className="form-control me-2"
              type="search"
              placeholder="Search"
              aria-label="Search"
            />
            <button className="btn btn-outline-success" type="submit">
              Search
            </button>
          </form> */}
          <label className="form-check-label" for="flexSwitchCheckDefault">Dark Mode</label>
          <div className="form-check form-switch">
          <input className="form-check-input" type="checkbox" role="switch" id="flexSwitchCheckDefault0"/>
          </div>
        </div>
      </div>
    </nav>
  );
}



Navbar.propTypes = {title: PropTypes.string.isRequired};

Navbar.defaultProps = {
    title: 'Set Title Here'
}
